import Navbar from './navigation';

const Layout = (props)=>(
    <div>
        <Head>
          <title>SpaceX</title>  
          <link rel="stylesheet" href="https://bootswatch.com/4/cerulean/bootstrap.min.css" />
        </Head>
        <Navbar/>
        <div className ="container">
        {props.children}
        </div>
       
    </div>
);

export default Layout;
